<!DOCTYPE html>
<html lang="es-ES">
<head>
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <meta http-equiv="X-UA-Compatible" content="ie=edge">

  <link rel="shortcut icon" href="icon.ico" type="image/x-icon">
  <link href="https://fonts.googleapis.com/css?family=Open+Sans+Condensed:300&display=swap" rel="stylesheet">
  <link href="https://fonts.googleapis.com/css?family=Roboto&display=swap" rel="stylesheet">

  <title>Generar Tasa</title>

  <style type="text/css">
    body, html {
      margin: 0;
      padding: 0;
      background-color: #eee; }
    label, input, button, select { font-family: 'Roboto'; font-size: 1rem; }
    input[type="file"] { font-size: .7rem; }

    .container {
      display: flex;
      flex-direction: column;
      justify-items: center;
      width: 300px;
      height: 100%;
      margin: auto;
      padding: 1rem 0;
      box-sizing: border-box; }

    form {
      margin: 1rem 0;
      padding: 10px 20px;
      display: flex;
      flex-direction: column;
      background: linear-gradient(#fff, #eee);
      border-radius: 6px;
      border: 1px solid #ddd; }
    form > span { margin: 10px 0; }

    .form-control {
      display: flex;
      flex-direction: row;
      align-items: center;
      margin-bottom: 5px;
    }
    .form-control > div {
      display: flex;
      align-items: center;
      justify-content: space-between;
    }
    .form-control > label { font-weight: bold; margin-right: 10px; min-width: 80px; }
    .form-control > *:not(label) { width: 100%; }
    
    input, select {
      padding: 5px 10px;
      outline: 0;
      border: 1px solid #ddd;
      -webkit-border-radius: 4px;
      border-radius: 4px;
      background: white; }
    input:focus, select:focus { background: #eee; }
    input[type="file"], input[type="color"], select { cursor: pointer; }
    input[type="text"] { width: 50px; text-align: center; }
    input#rate { width: 80px; }
    input[type="color"] { width: 40px; }
    button {
      margin-top: 15px;
      padding: 10px 0;
      font-weight: bold;
      outline: 0;
      border: 1px solid #ccc;
      -webkit-border-radius: 4px;
      border-radius: 4px;
      cursor: pointer;
      font-size: 1.2rem; }
    button:hover, button:focus { background-color: black; color: white; }

    h1, ul {
      margin: 0;
      align-self: center;
      font-family: 'Open Sans Condensed'; 
      cursor: default; }

    ul {
      display: flex;
      flex-direction: row;
      align-items: center;
      justify-content: center;
      list-style: none;
      padding-left: 0; }
    ul > span { margin: 0 10px; }
    a { text-decoration: none; color: black; outline: 0; }
    a:hover, a:focus { text-decoration: underline; }
  </style>
</head>
<body>
<div class="container">
  <h1><img src="icon.ico" style="margin-right: 10px;">Generar Tasa</h1>

  <form onsubmit="return downloadImage()">
    <div class="form-control">
      <label>Imagen</label>
      <input type="file" accept="image/jpeg">
    </div>
    <span></span>
    <div class="form-control">
      <label>Tasa</label>
      <div>
      <input id="rate" type="number" min="0.00001" step="0.00001" placeholder="Ex: 0.12" required>
      <input type="color" value="#ffffff">
      </div>
    </div>
    <div class="form-control">
      <label>Operaci√≥n</label>
      <select>
        <option>Dividir</option>
        <option>Multiplicar</option>
      </select>
    </div>
    <div class="form-control">
      <label>Monedas</label>
      <div>
        <input type="text" minlength="1" maxlength="5" required value="$">
        <label>a</label>
        <input type="text" minlength="1" maxlength="5" required value="Bs. ">
      </div>
    </div>
    <span></span>
    <div class="form-control">
      <label>Valor 01</label>
      <input type="number" class="value" min="0" required placeholder="Ex: 20000" value="20000">
    </div>
    <div class="form-control">
      <label>Valor 02</label>
      <input type="number" class="value" min="0" required placeholder="Ex: 30000" value="30000">
    </div>
    <div class="form-control">
      <label>Valor 03</label>
      <input type="number" class="value" min="0" required placeholder="Ex: 40000" value="40000">
    </div>
    <div class="form-control">
      <label>Valor 04</label>
      <input type="number" class="value" min="0" required placeholder="Ex: 50000" value="50000">
    </div>
    <div class="form-control">
      <label>Valor 05</label>
      <input type="number" class="value" min="0" required placeholder="Ex: 60000" value="60000">
    </div>
    <div class="form-control">
      <label>Valor 06</label>
      <input type="number" class="value" min="0" required placeholder="Ex: 70000" value="70000">
    </div>
    <div class="form-control">
      <label>Valor 07</label>
      <input type="number" class="value" min="0" required placeholder="Ex: 80000" value="80000">
    </div>
    <div class="form-control">
      <label>Valor 08</label>
      <input type="number" class="value" min="0" required placeholder="Ex: 90000" value="90000">
    </div>
    <div class="form-control">
      <label>Valor 09</label>
      <input type="number" class="value" min="0" required placeholder="Ex: 100000" value="100000">
    </div>
    <div class="form-control">
      <label>Valor 10</label>
      <input type="number" class="value" min="0" required placeholder="Ex: 150000" value="150000">
    </div>
    <div class="form-control">
      <label>Valor 11</label>
      <input type="number" class="value" min="0" required placeholder="Ex: 200000" value="200000">
    </div>
    <div class="form-control">
      <label>Valor 12</label>
      <input type="number" class="value" min="0" required placeholder="Ex: 300000" value="300000">
    </div>

    <button>Listo!</button>
  </form>
